void shtepsel_check_material(uint16_t face)
{
	uint16_t mat,i,n_faces;
	char flg;
	GLfloat params[4];

	for(mat=0;mat<Num_shtepsel_materials;mat++)
	{
		n_faces=shtepsel_materials[mat].start_faces_length;
		flg=0;
		if(n_faces)
		{
			for(i=0;i<n_faces;i++)
			{
				if(shtepsel_materials[mat].start_faces[i]==face) flg=1;
			}
		}
		if(flg)    // Select material
		{
			params[0]=shtepsel_materials[mat].Ka[0];
			params[1]=shtepsel_materials[mat].Ka[1];
			params[2]=shtepsel_materials[mat].Ka[2];
			params[3]=shtepsel_materials[mat].Ka_alpha;
			glMaterialfv (GL_FRONT_AND_BACK,GL_AMBIENT,params);
			params[0]=shtepsel_materials[mat].Kd[0];
			params[1]=shtepsel_materials[mat].Kd[1];
			params[2]=shtepsel_materials[mat].Kd[2];
			params[3]=shtepsel_materials[mat].Kd_alpha;
			glMaterialfv (GL_FRONT_AND_BACK,GL_DIFFUSE,params);
			params[0]=shtepsel_materials[mat].Ks[0];
			params[1]=shtepsel_materials[mat].Ks[1];
			params[2]=shtepsel_materials[mat].Ks[2];
			params[3]=shtepsel_materials[mat].Ks_alpha;
			glMaterialfv (GL_FRONT_AND_BACK,GL_SPECULAR,params);
			glMaterialf (GL_FRONT_AND_BACK,GL_SHININESS,shtepsel_materials[mat].Ns);
			shtepsel_bind_texture(mat);
		}
	}
}

GLint shtepsel_generate_list()
{
	uint16_t i,j;
	int32_t ind;
	GLint list;

	shtepsel_materials_init();
	list=glGenLists(1);
	glNewList(list,GL_COMPILE);
	for(i=0;i<Num_shtepsel_faces;i++)
	{
	shtepsel_check_material(i);
	glBegin(GL_TRIANGLES);
		for(j=0;j<3;j++)
		{
			ind=shtepsel_faces[i][j][1]-1;
			if(ind>0)glTexCoord2f(shtepsel_texcoords[ind][0],shtepsel_texcoords[ind][1]);
			ind=shtepsel_faces[i][j][2]-1;
			glNormal3f(shtepsel_normals[ind][0],shtepsel_normals[ind][1],shtepsel_normals[ind][2]);
			ind=shtepsel_faces[i][j][0]-1;
			glVertex3f(shtepsel_vertex[ind][0],shtepsel_vertex[ind][1],shtepsel_vertex[ind][2]);
		}
		glEnd();
	}
	glEndList();
	return list;
}
